query ProjectByPath(
  $id: String!
) {
  markdownRemark(id: {eq: $id}) {
    html
    frontmatter {
      path
      title
      subtitle
      cover_image {
        childImageSharp {
          fluid(maxHeight: 700) {
            ...GatsbyImageSharpFluid
          }
        }
      }
    }
  }
}

fragment GatsbyImageSharpFluid on ImageSharpFluid {
  base64
  aspectRatio
  src
  srcSet
  sizes
}

